import React, { Component } from 'react';

export default class ParentComponent extends Component {
  render() {
    // Assuming you have received props in this parent component
    const { title, content, imageUrl, author } = this.props;

    return (
      <div>
        {/* Render the Detail component and pass props */}
        <Detail
          title={title}
          content={content}
          imageUrl={imageUrl}
          author={author}
        />
      </div>
    );
  }
}
